<script>
import vueSelect from "vue-select";
import "vue-select/dist/vue-select.css";
import { countries } from "static/countries.js";
export default {
  data() {
    return {
      user: {},
      showModal: false,
      selectedCountry: "",
      items: countries.items
    };
  },
  methods: {
    open() {
      this.showModal = true;
      const x = window.scrollX;
      const y = window.scrollY;
      window.onscroll = function() {
        window.scrollTo(x, y);
      };
    },
    close() {
      this.showModal = false;
      window.onscroll = function() {};
    },

    async register() {
      var first = document.getElementById("first-name").value;
      var last = document.getElementById("last-name").value;
      var username = document.getElementById("username").value;
      var pass = document.getElementById("password").value;
      var emailValue = document.getElementById("email").value;
      var birthdayValue = document.getElementById("birthday").value;
      var countryValue = this.selectedCountry;

      var user = {
        firstName: first,
        lastName: last,
        username: username,
        passwordHash: pass,
        email: emailValue,
        birthday: birthdayValue,
        country: countryValue
      };

      try {
        await this.$axios
          .post("https://orangebush.azurewebsites.net/Auth/Register", user)
          .catch(e => console.log(e.message));
      } catch (e) {
        // console.log(res.code);
        // console.log(res.message);
      }
      console.log(user);
      this.close();
    }
  },
  components: {
    vueSelect
  }
};
</script>

